import React, { Component } from "react";

class Order extends Component {
  render() {
    const orderFishIds = Object.keys(this.props.order);
    const total = orderFishIds.reduce();
    return (
      <div className="order-wrap">
        <h2>Order</h2>
        <ul>
          <li>{orderFishIds}</li>
        </ul>
      </div>
    );
  }
}

export default Order;
